import "./Home.css";
import Navbar from "./Navbar";
import Home from "./Home";
import About from "./About";

function App(props) {
    let Component;
  switch (window.location.pathname) {
    case "/":
        Component = <Home />
        break;
    case "/about":
        Component = <About />
        break;
    case "/trombi":
        Component = "Trombinoscope"
        break;

    default:
      break;
  }
}

export default App;
